import React, { Component } from 'react';
import { View, Text, SafeAreaView } from 'react-native';
class HomeScreen extends Component {
    constructor(props) {
        super(props)
        const { item } = this.props.route.params;
    }
    testHomeScreen = () => {

        return (
            <SafeAreaView style={{ flex: 1 }}>
                {item}
            </SafeAreaView>
        );
    };
}


export default HomeScreen;
